	protected boolean generate(Set<BlockPos> changedBlocks, WorldGenLevel world, Random rand, BlockPos pos, BoundingBox boundsIn, boolean isSapling, PFTreeConfig config) {

		this.randTreeHeight = config.getMinHeight() + rand.nextInt(config.getMaxPossibleHeight());
		this.mainmutable = new BlockPos.MutableBlockPos().set(pos);

        if (pos.getY() + randTreeHeight + 1 < world.getHeight()) {
        	if (!this.isAnotherTreeNearby(world, pos, randTreeHeight, 0, isSapling)) {
                return false;
            } else if (!this.doesSaplingHaveSpaceToGrow(world, pos, randTreeHeight, 7, 5, 5, isSapling)) {
                return false;
            } else {
				
            	mainmutable.set(pos);
				generate1(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
				generate2(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
				generate3(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
				generate4(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
				generate5(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
				generate6(changedBlocks, world, rand, pos, boundsIn, isSapling, config);
            	
            }
        }
        return true;
    }
	
